.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);

  margin-bottom: 1em;
}
.cucumber-report-header > * {

  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {

}
.cucumber-report-header .cucumber-search-bar p.help {

.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {

  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {

  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;

  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }

    padding: 10px;

}

    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;

{"source":{"uri":"features/specs/principal.feature","data":"  #language: pt\n\n  Funcionalidade: Validar acesso principal e menus em STG\n\n    @valido_tela\n    Cenario: Valido links do menu principal\n      Dado que estou na pagina principal Massas Manfron\n      E vejo e as opções de produtos \"Pães\"\n      E vejo e as opções de produtos \"Lasanhas\"\n      E vejo e as opções de produtos \"Empadões\"\n\n    @valido_tela\n    Cenario: Valido cards de produtos\n      Dado que estou na pagina principal Massas Manfron\n      E clico a opção de produtos \"Pães\"\n      E clico a opção de produtos \"Lasanhas\"\n      E clico a opção de produtos \"Empadões\"\n\n    @valido_login\n    Cenario: Valido acesso ao login\n      Dado que estou na pagina principal Massas Manfron\n      E vejo e as opções de produtos \"Pães\"\n      E vejo e as opções de produtos \"Lasanhas\"\n      E vejo e as opções de produtos \"Empadões\"\n      E clico em login\n      E visualizo a tela de login\n      E clico em criar conta\n      E vou para tela de cadastro\n      E preencho E-mail \"loannvitor\"\n      E insiro o Nome completo  \"Loann Vitor Marques de Oliveira\"\n      E coloco a Data de nascimento \"24/03/2004\"\n      E insiro o CPF \"10139207910\"\n      E preeencho o Telefone \"41998634188\"\n      E coloco o CEP \"82700-380\"\n      E informo o bairo \"Barreirinha\"\n      E coloco o endereço \"Rua dos Ipês Número 201\"\n      Quando marco aceite aos termos e condições\n      Então registro as informações\n\n    @valido_perfil\n    Cenario: Valido tela de perfil\n      Dado que estou na pagina Perfil usuário\n      E vejo o texto \"Seus dados\"\n      E exibe E-mail \"loannvitor\"\n      E exibe o Nome completo  \"Loann Vitor Marques de Oliveira\"\n      E exibe a Data de nascimento \"24/03/2004\"\n      E exibe o CPF \"10139207910\"\n      E exibe o Telefone \"(41) 99863-4188\"\n      E exibe o CEP \"82700-380\"\n      E exibe o bairo \"Barreirinha\"\n      E exibe o endereço \"Rua dos Ipês Número 201\"\n      E Alterar dados cadastrados\n\n    @valido_tela_de_cadasatro_de_produto\n    Cenario: Valido tela de cadastro de produto\n      Dado que estou na pagina Cadastro produto\n      E vejo o texto \"Cadastre o produo\"\n      E preencho o Nome do produto \"Lasanha Bolonhesa\"\n      E informo a Categoria do produto \"Lasanha\"\n      E escrevo a Quantidade \"20\"\n      E preencho Senha \"123456789\"\n      E clico em Cadastrar\n\n\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},
